import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';

import MacMini from './components/details/Mac-mini'
import MacPro from './components/details/Mac-pro'
import MacbookAir from './components/details/macbook-air';
import MacbookPro from './components/details/macbook-pro';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useRouteMatch,
  useParams
} from "react-router-dom";



ReactDOM.render(

  <Router>
  <div>
    {/* <nav>
      <ul>
        <li>
          <Link to="/">Home</Link>
        </li>
        <li>
          <Link to="/components/details/Mac-pro">Pro</Link>
        </li>
        <li>
          <Link to="/components/details/Mac-mini">mini</Link>
        </li>
      </ul>
    </nav> */}

    {/* A <Switch> looks through its children <Route>s and
        renders the first one that matches the current URL. */}
    <Switch>
    <Route path="/components/details/macbook-air">
        <MacbookAir />
      </Route>
      <Route path="/components/details/macbook-pro">
        <MacbookPro />
      </Route>
      <Route path="/components/details/Mac-pro">
        <MacPro />
      </Route>
      <Route path="/components/details/Mac-mini">
        <MacMini />
      </Route>
      <Route path="/">
        <App />
      </Route>
    </Switch>
  </div>
</Router>,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
